      out.write("<body>\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("\t<!-- 지도 안, 검색박스  -->\r\n");
      out.write("\t<div class=\"map_wrap\">\r\n");
      out.write("\t\t<div id=\"map\"\r\n");
      out.write("\t\t\tstyle=\"width: 100%; height: 100%; position: relative; overflow: hidden;\"></div>\r\n");
      out.write("\r\n");
      out.write("\t\t<div id=\"menu_wrap\" class=\"bg_white\" style=\"z-index: 2;\">\r\n");
      out.write("\t\t\t<div class=\"option\">\r\n");
      out.write("\t\t\t\t<div>\r\n");
      out.write("\t\t\t\t\t<form onsubmit=\"searchPlaces(); return false;\">\r\n");
      out.write("\t\t\t\t\t\t키워드 : <input type=\"text\" value=\"\" id=\"keyword\" required><br>\r\n");
      out.write("\t\t\t\t\t\t<button type=\"submit\">검색</button>\r\n");
      out.write("\t\t\t\t\t\t<button type=\"button\" onclick=\"popupOpen();\">등록</button>\r\n");
