      out.write("\t\t\t\t</div>\r\n");
      out.write("\t\t\t</div>\r\n");
      out.write("\t\t\t<hr>\r\n");
      out.write("\t\t\t<ul class=\"placesList2\" id=\"placesList\"></ul>\r\n");
      out.write("\t\t\t<div id=\"pagination\"></div>\r\n");
      out.write("\t\t</div>\r\n");
      out.write("\t</div>\r\n");
      out.write("\r\n");
      out.write("    <!-- 팝업 로드 -->\r\n");
      out.write("\t<script>\r\n");
      out.write("\t\tfunction popupOpen(){\r\n");
      out.write("\t\tvar popUrl = \"popup.jsp?A=\"+A+\"&B=\"+B;\t//팝업창에 출력될 페이지 URL\r\n");
      out.write("\t\tvar popOption = \"width=370, height=360, resizable=no, scrollbars=no, status=no;\";    //팝업창 옵션(optoin)\r\n");
      out.write("\t\twindow.open(popUrl,\"\",popOption);\r\n");
      out.write("\t}\r\n");
      out.write("\t</script>\t\r\n");
      out.write("\r\n");
      out.write("\t<!-- 지도 API로드 -->\r\n");
      out.write("\t<script type=\"text/javascript\" src=\"//dapi.kakao.com/v2/maps/sdk.js?appkey=9db7af1214b0f763e2d8fd3b9129b6d9&libraries=services\"></script>\r\n");
      out.write("\t\r\n");
      out.write("\t<!-- 지도 로직 -->\r\n");
      out.write("\t<script>\r\n");
      out.write("\r\n");
      out.write("\t\t// 마커를 담을 배열\r\n");
      out.write("\t\tvar markers = [];\r\n");
      out.write("\r\n");
      out.write("\t\tvar mapContainer = document.getElementById('map'), // 지도를 표시할 div \r\n");
      out.write("\t\tmapOption = {\r\n");
      out.write("\t\t\tcenter : new kakao.maps.LatLng(37.4990000,127.0328800), // 지도의 중심좌표(KH학원 기준)\r\n");
      out.write("\t\t\tlevel : 4\r\n");
      out.write("\t\t// 지도의 확대 레벨\r\n");
      out.write("\t\t};\r\n");
      out.write("\t\t// 지도를 생성\r\n");
      out.write("\t\tvar map = new kakao.maps.Map(mapContainer, mapOption);\r\n");
      out.write("\r\n");
      out.write("\t\t\r\n");
      out.write("\t\t// 지도에 원을 표시(학원에서 250m기준)\r\n");
      out.write("\t\tvar circle = new kakao.maps.Circle({\r\n");
      out.write("\t\t\tmap: map, // 원을 표시할 지도 객체\r\n");
      out.write("\t\t\tcenter : new kakao.maps.LatLng(37.4990000,127.03288002), // 지도의 중심 좌표\r\n");
      out.write("\t\t\tradius : 250, // 원의 반지름 (단위 : m)\r\n");
      out.write("\t\t\tfillColor: '#f8fc09', // 채움 색\r\n");
      out.write("\t\t\tfillOpacity: 0.2, // 채움 불투명도\r\n");
      out.write("\t\t\tstrokeWeight: 1, // 선의 두께\r\n");
      out.write("\t\t\tstrokeColor: '#83842f', // 선 색\r\n");
      out.write("\t\t\tstrokeOpacity: 0.3, // 선 투명도 \r\n");
      out.write("\t\t\tstrokeStyle: 'solid' // 선 스타일\r\n");
      out.write("\t\t});\t\r\n");
      out.write("\t\t\r\n");
      out.write("\t\t\r\n");
      out.write("\r\n");
      out.write("\t\t// 장소 검색 객체를 생성\r\n");
      out.write("\t\tvar ps = new kakao.maps.services.Places();\r\n");
      out.write("\r\n");
      out.write("\t\t// 검색 결과 목록이나 마커를 클릭했을 때 장소명을 표출할 인포윈도우를 생성합니다\r\n");
      out.write("\t\tvar infowindow = new kakao.maps.InfoWindow({\r\n");
      out.write("\t\t\tzIndex : 1\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t});\r\n");
      out.write("\r\n");
      out.write("\t\t// 키워드로 장소를 검색합니다\r\n");
      out.write("\t\tsearchPlaces();\r\n");
      out.write("\t\t// 키워드 검색을 요청하는 함수입니다\r\n");
      out.write("\t\tfunction searchPlaces() {\r\n");
      out.write("\t\t\tvar keyword = document.getElementById('keyword').value;\r\n");
      out.write("\t\t\tif (!keyword.replace(/^\\s+|\\s+$/g, '')) {\r\n");
      out.write("\t\t\t\t//alert('맛집을 입력해주세요!');\r\n");
      out.write("\t\t\t\treturn false;\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\r\n");
      out.write("\t\t\t// 장소검색 객체를 통해 키워드로 장소검색을 요청합니다\r\n");
      out.write("\t\t\tps.keywordSearch(keyword, placesSearchCB);\r\n");
      out.write("\t\t}\r\n");
      out.write("\r\n");
      out.write("\t\t// 장소검색이 완료됐을 때 호출되는 콜백함수 입니다\r\n");
      out.write("\t\tfunction placesSearchCB(data, status, pagination) {\r\n");
      out.write("\t\t\tif (status === kakao.maps.services.Status.OK) {\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t// 정상적으로 검색이 완료됐으면\r\n");
      out.write("\t\t\t\t// 검색 목록과 마커를 표출합니다\r\n");
      out.write("\t\t\t\tdisplayPlaces(data);\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t// 페이지 번호를 표출합니다\r\n");
      out.write("\t\t\t\tdisplayPagination(pagination);\r\n");
      out.write("\r\n");
      out.write("\t\t\t} else if (status === kakao.maps.services.Status.ZERO_RESULT) {\r\n");
      out.write("\r\n");
      out.write("\t\t\t\talert('검색 결과가 존재하지 않습니다.');\r\n");
      out.write("\t\t\t\treturn;\r\n");
      out.write("\r\n");
      out.write("\t\t\t} else if (status === kakao.maps.services.Status.ERROR) {\r\n");
      out.write("\r\n");
      out.write("\t\t\t\talert('검색 결과 중 오류가 발생했습니다.');\r\n");
      out.write("\t\t\t\treturn;\r\n");
      out.write("\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\t\t}\r\n");
      out.write("\r\n");
      out.write("\t\r\n");
      out.write("\t\tvar B = null;\r\n");
      out.write("\t\t\r\n");
      out.write("\t\t// 검색 결과 목록과 마커를 표출하는 함수입니다\r\n");
      out.write("\t\tfunction displayPlaces(places) {\r\n");
      out.write("\r\n");
      out.write("\t\t\tvar listEl = document.getElementById('placesList'), menuEl = document\r\n");
      out.write("\t\t\t\t\t.getElementById('menu_wrap'), fragment = document\r\n");
      out.write("\t\t\t\t\t.createDocumentFragment(), bounds = new kakao.maps.LatLngBounds(), listStr = '';\r\n");
      out.write("\r\n");
      out.write("\t\t\t// 검색 결과 목록에 추가된 항목들을 제거합니다\r\n");
      out.write("\t\t\tremoveAllChildNods(listEl);\r\n");
      out.write("\r\n");
      out.write("\t\t\t// 지도에 표시되고 있는 마커를 제거합니다\r\n");
      out.write("\t\t\tremoveMarker();\r\n");
      out.write("\r\n");
      out.write("\t\t\tfor (var i = 0; i < places.length; i++) {\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t// 마커를 생성하고 지도에 표시합니다\r\n");
      out.write("\t\t\t\tvar placePosition = new kakao.maps.LatLng(places[i].y,\r\n");
      out.write("\t\t\t\t\t\tplaces[i].x), marker = addMarker(placePosition, i), itemEl = getListItem(\r\n");
      out.write("\t\t\t\t\t\ti, places[i]); // 검색 결과 항목 Element를 생성합니다\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t// 검색된 장소 위치를 기준으로 지도 범위를 재설정하기위해\r\n");
      out.write("\t\t\t\t// LatLngBounds 객체에 좌표를 추가합니다\r\n");
      out.write("\t\t\t\tbounds.extend(placePosition);\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t// 마커와 검색결과 항목에 mouseover 했을때\r\n");
      out.write("\t\t\t\t// 해당 장소에 인포윈도우에 장소명을 표시합니다\r\n");
      out.write("\t\t\t\t// mouseout 했을 때는 인포윈도우를 닫습니다\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\t(function(marker, title) {\r\n");
      out.write("\t\t\t\t\tkakao.maps.event.addListener(marker, 'click',\r\n");
      out.write("\t\t\t\t\t\t\tfunction() {\r\n");
      out.write("\t\t\t\t\t\t\t\tdisplayInfowindow(marker, title);\r\n");
      out.write("\t\t\t\t\t\t\t});\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\tkakao.maps.event.addListener(marker, 'mouseout',\r\n");
      out.write("\t\t\t\t\t\t\tfunction() {\r\n");
      out.write("\t\t\t\t\t\t\t\tinfowindow.close();\r\n");
      out.write("\t\t\t\t\t\t\t});\r\n");
      out.write("\t\t\t\t\t\r\n");
      out.write("\t\t\t\t\t/* document.getElementById('placesList').onclick = function () {\r\n");
      out.write("\t\t\t\t\t\tdisplayInfowindow(marker, title);\r\n");
      out.write("\t\t\t\t\t\t}; */\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\t\t  itemEl.onmousedown = function() {\r\n");
      out.write("\t\t\t\t\t\tdisplayInfowindow(marker, title);\r\n");
      out.write("\t\t\t\t\t\t$(this).css({\"background\":\"black\",\"color\":\"white\",\"opacity\":\"0.5\"});\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t\t\t\t\tB = $(this).find(\"#address\").text();  // find메소드로 하위 개체들을 찾아올 수 있게 해줘야, 정확한 위치로 간다.\r\n");
      out.write("\t\t\t\t\t\talert(B);\r\n");
      out.write("\t\t\t\t\t};\r\n");
      out.write("\t\t\t\t\t\r\n");
      out.write("\t\t\t\t\titemEl.onmouseout = function() {\r\n");
      out.write("\t\t\t\t\t\tinfowindow.close();\r\n");
      out.write("\t\t\t\t\t};   \t\r\n");
      out.write("\t\t\t\t})(marker, places[i].place_name);\r\n");
      out.write("\r\n");
      out.write("\t\t\t\tfragment.appendChild(itemEl);\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\r\n");
      out.write("\t\t\t// 검색결과 항목들을 검색결과 목록 Elemnet에 추가합니다\r\n");
      out.write("\t\t\tlistEl.appendChild(fragment);\r\n");
      out.write("\t\t\tmenuEl.scrollTop = 0;\r\n");
      out.write("\r\n");
      out.write("\t\t\t// 검색된 장소 위치를 기준으로 지도 범위를 재설정합니다\r\n");
      out.write("\t\t\tmap.setBounds(bounds);\r\n");
      out.write("\t\t}\r\n");
      out.write("\t\t// ##################################################################### 여기서 뽑아와야함.\r\n");
      out.write("\t\t// 검색결과 항목을 Element로 반환하는 함수입니다\r\n");
      out.write("\t\t\r\n");
      out.write("\t\t\r\n");
      out.write(" \t\tfunction getListItem(index, places) {\r\n");
      out.write("\t\t\tvar el = document.createElement('li'), itemStr = '<span class=\"markerbg marker_'\r\n");
      out.write("\t\t\t\t\t+ (index + 1)\r\n");
      out.write("\t\t\t\t\t+ '\"></span>'\r\n");
      out.write("\t\t\t\t\t+ '<div class=\"info\">'\r\n");
      out.write("\t\t\t\t\t+ '   <h5 id=\"TRname2\">' + places.place_name + '</h5>';\r\n");
      out.write("\r\n");
      out.write("\t\t\tif (places.road_address_name) {\r\n");
      out.write("\t\t\t\titemStr += '    <span id=address>' + places.road_address_name + '</span>'\r\n");
      out.write("\t\t\t\t\t\t+ '   <span class=\"jibun gray\">' + places.address_name\r\n");
      out.write("\t\t\t\t\t\t+ '</span>';\r\n");
      out.write("\t\t\t} else {\r\n");
      out.write("\t\t\t\titemStr += '    <span>' + places.address_name + '</span>';\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\r\n");
      out.write("\t\t\titemStr += '  <span class=\"tel\">' + places.phone + '</span>'\r\n");
      out.write("\t\t\t\t\t+ '</div>';\r\n");
      out.write("\r\n");
      out.write("\t\t\tel.innerHTML = itemStr;\r\n");
      out.write("\t\t\tel.className = 'item';\r\n");
      out.write("\t\t\t\r\n");
      out.write("\t\t\treturn el;\r\n");
      out.write("\t\t} \r\n");
      out.write("\r\n");
      out.write("\t\t// 마커를 생성하고 지도 위에 마커를 표시하는 함수입니다\r\n");
      out.write("\t\tfunction addMarker(position, idx, title) {\r\n");
      out.write("\t\t\tvar imageSrc = 'http://t1.daumcdn.net/localimg/localimages/07/mapapidoc/marker_number_blue.png', // 마커 이미지 url, 스프라이트 이미지를 씁니다\r\n");
      out.write("\t\t\timageSize = new kakao.maps.Size(36, 37), // 마커 이미지의 크기\r\n");
      out.write("\t\t\timgOptions = {\r\n");
      out.write("\t\t\t\tspriteSize : new kakao.maps.Size(36, 691), // 스프라이트 이미지의 크기\r\n");
      out.write("\t\t\t\tspriteOrigin : new kakao.maps.Point(0, (idx * 46) + 10), // 스프라이트 이미지 중 사용할 영역의 좌상단 좌표\r\n");
      out.write("\t\t\t\toffset : new kakao.maps.Point(13, 37)\r\n");
      out.write("\t\t\t// 마커 좌표에 일치시킬 이미지 내에서의 좌표\r\n");
      out.write("\t\t\t}, markerImage = new kakao.maps.MarkerImage(imageSrc, imageSize,\r\n");
      out.write("\t\t\t\t\timgOptions), marker = new kakao.maps.Marker({\r\n");
      out.write("\t\t\t\tposition : position, // 마커의 위치\r\n");
      out.write("\t\t\t\timage : markerImage\r\n");
      out.write("\t\t\t});\r\n");
      out.write("\r\n");
      out.write("\t\t\tmarker.setMap(map); // 지도 위에 마커를 표출합니다\r\n");
      out.write("\t\t\tmarkers.push(marker); // 배열에 생성된 마커를 추가합니다\r\n");
      out.write("\r\n");
      out.write("\t\t\treturn marker;\r\n");
      out.write("\t\t}\r\n");
      out.write("\r\n");
      out.write("\t\t// 지도 위에 표시되고 있는 마커를 모두 제거합니다\r\n");
      out.write("\t\tfunction removeMarker() {\r\n");
      out.write("\t\t\tfor (var i = 0; i < markers.length; i++) {\r\n");
      out.write("\t\t\t\tmarkers[i].setMap(null);\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\t\t\tmarkers = [];\r\n");
      out.write("\t\t}\r\n");
      out.write("\r\n");
      out.write("\t\t// 검색결과 목록 하단에 페이지번호를 표시는 함수입니다\r\n");
      out.write("\t\tfunction displayPagination(pagination) {\r\n");
      out.write("\t\t\tvar paginationEl = document.getElementById('pagination'), fragment = document\r\n");
      out.write("\t\t\t\t\t.createDocumentFragment(), i;\r\n");
      out.write("\r\n");
      out.write("\t\t\t// 기존에 추가된 페이지번호를 삭제합니다\r\n");
      out.write("\t\t\twhile (paginationEl.hasChildNodes()) {\r\n");
      out.write("\t\t\t\tpaginationEl.removeChild(paginationEl.lastChild);\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\r\n");
      out.write("\t\t\tfor (i = 1; i <= pagination.last; i++) {\r\n");
      out.write("\t\t\t\tvar el = document.createElement('a');\r\n");
      out.write("\t\t\t\tel.href = \"#\";\r\n");
      out.write("\t\t\t\tel.innerHTML = i;\r\n");
      out.write("\r\n");
      out.write("\t\t\t\tif (i === pagination.current) {\r\n");
      out.write("\t\t\t\t\tel.className = 'on';\r\n");
